import index from './index.js';

function ShopingCards(props){

    const items = [

        {
            name:'Boys-Shirt',
            img: 'image1.jpg',
            desc: '₹600' ,
        },

        {
            name:'Boys-Shirt',
            img: 'image2.jpg',
            desc: '₹600' ,
        },

        {
            name:'Boys-Shirt',
            img: 'image3.jpg',
            desc: '₹600' ,
        },

        {
            name:'Boys-Shirt',
            img: 'image4.jpg',
            desc: '₹600' ,
        },
    ]


    return (
        <div>
            <index name={itemval[0].name}
            img={itemval[0].img}
            desc={itemval[0].desc}>
            </index>

            <index name={itemval[1].name}
            img={itemval[1].img}
            desc={itemval[1].desc}>
            </index>

            <index name={itemval[2].name}
            img={itemval[2].img}
            desc={itemval[2].desc}>
            </index>

            <index name={itemval[3].name}
            img={itemval[3].img}
            desc={itemval[3].desc}>
            </index>

        </div>
        
        );
 }
 
 export default ShopingCards;
